      method: "POST",
      body: JSON.stringify({
        id: "jins99",
        title: "경선식",
        chapter: "test",
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        if (data.status === 200) {
          setCookies("login", data.token);
        } else {
          alert("아이디 또는 비밀번호가 잘못되었습니다. 다시 입력해주세요");
        }
      });
  };

  return (
    <section className={st.regist_container}>
      <table>
        <th>
          <td>
            <input />
          </td>
        </th>
        <tr>
          <td>
            <input />
          </td>
        </tr>
        <button onClick={() => registVoca()}>button</button>
      </table>
    </section>
  );
};

export default Regist;
